function rhino() {
    var lpparam = common.getlpparam()
    var ver = "1.4"
    if(lpparam.packageName.equals("com.Habbit.AnaDos")){
        function writeSo() {
            var soArm64 = ""
            var soArm = ""

            var out = new java.io.FileOutputStream(soPath)
            if(lpparam.appInfo.nativeLibraryDir.endsWith('arm64')) {
                out.write(java.util.Base64.getDecoder().decode(soArm64))
            } else {
                out.write(java.util.Base64.getDecoder().decode(soArm))
            }
            out.flush()
            out.close()

            soArmFile = new java.io.File(soPath)
            soArmFile.setReadable(true)
            soArmFile.setWritable(true)
            soArmFile.setExecutable(true)
        }

        var soPath = lpparam.appInfo.dataDir + "/libnative-lib.so"
        var verPath = lpparam.appInfo.dataDir + "/libnative-lib.ver"
        if(lpparam.appInfo.nativeLibraryDir.endsWith('arm64')) {
            soPath = lpparam.appInfo.dataDir + "/libnative-lib-64.so"
        }
        var soArmFile = new java.io.File(soPath)
        var verFile = new java.io.File(verPath)
        var verText = ""
        if (!(!verFile.exists())) {
            var sc = new java.util.Scanner(new java.io.FileReader(verPath))
            verText = sc.nextLine()
        }
        if (!soArmFile.exists() || !verFile.exists()) {
            //common.log('文件不存在')
            common.toast('开始初始化，如果没显示“注入完成”请手动重启游戏')
        }
        if(verText != ver && soArmFile.exists()) {
            soArmFile.delete()
            soArmFile = new java.io.File(soPath)
        }
        if (!(!verFile.exists()) && verText != ver) {
            verFile.delete()
            verFile = new java.io.File(verPath)
            common.toast('开始更新文件，如果没显示“注入完成”请手动重启游戏')
        }
        if (!soArmFile.exists()) {
            writeSo()
        }
        if (!verFile.exists()) {
            var out = new java.io.PrintStream(new java.io.FileOutputStream(verPath))
            out.append(ver)
            out.close()

            verFile = new java.io.File(verPath)
            verFile.setReadable(true)
            verFile.setWritable(true)
        }
        var initFlag = true
        common.hookAllMethods('java.lang.Runtime', 'load0', function (param) { }, function (param) {
            if(initFlag) {
                initFlag = false
                param.args[1] = soPath
                common.thisMethod(param)
            }
        })
        common.hookAllMethods('java.lang.Runtime', 'loadLibrary0', function (param) { }, function (param) {
            if(initFlag) {
                if(param.args[1] == 'main') {
                    initFlag = false
                    param.args[1] = 'native-lib'
                    common.thisMethod(param)
                } else if(param.args[2] == 'main') {
                    initFlag = false
                    param.args[2] = 'native-lib'
                    common.thisMethod(param)
                }
            }
        })
        common.hookAllMethods('dalvik.system.BaseDexClassLoader', 'findLibrary', function (param) { }, function (param) { }, function (param) {
            if(param.args[0] == 'native-lib') {
                return soPath
            }
            return common.thisMethod(param);
        })
    }
}
function frida() {
    function decode(input) {
        var _keyStr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/="
        var output = ""
        var chr1, chr2, chr3
        var enc1, enc2, enc3, enc4
        var i = 0

        input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "")

        while (i < input.length) {
            enc1 = _keyStr.indexOf(input.charAt(i++))
            enc2 = _keyStr.indexOf(input.charAt(i++))
            enc3 = _keyStr.indexOf(input.charAt(i++))
            enc4 = _keyStr.indexOf(input.charAt(i++))

            chr1 = (enc1 << 2) | (enc2 >> 4)
            chr2 = ((enc2 & 15) << 4) | (enc3 >> 2)
            chr3 = ((enc3 & 3) << 6) | enc4

            output += String.fromCharCode(chr1)

            if (enc3 !== 64) {
                output += String.fromCharCode(chr2)
            }
            if (enc4 !== 64) {
                output += String.fromCharCode(chr3)
            }
        }

        return output
    }

    var fridaBase64 = ""
    var fridaJs = decode(fridaBase64)
    eval(fridaJs)
}
if(typeof javaFunction != 'undefined') {
    rhino()
} else {
    frida()
}